import React from 'react';

class NewNav extends React.Component{
  render(){
    return(
      <div className="navigation">
      <input type="checkbox" className="navigation__checkbox" id="navi-toggle"/>
      <label className="navigation-button">MENU</label>
      <div className="navigation__background">&nbsp;</div>
      <nav className="navigation__nav">
        <ul className="navigation__list">
          <li className="navigation__item"><a href="#" className="navigation__link">Home </a></li>
          <li className="navigation__item"><a href="#" className="navigation__link">Playlist</a></li>
          <li className="navigation__item"><a href="#" className="navigation__link"> Sign UP</a></li>
          <li className="navigation__item"><a href="#" className="navigation__link">Login</a></li>
          <li className="navigation__item"><a href="#" className="navigation__link">Header</a></li>
          <li className="navigation__item"><a href="#" className="navigation__link">Chat</a></li>
        </ul>
      </nav>
      </div>
    )
  }

}
export default NewNav;
